import React from "react";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import PageScrollTop from "./components/pageToTop/PageScrollTop";

// Pages import Here

import HomeScreen from "./screens/HomeScreen";

// Import Css Here
import "./assets/scss/style.scss";
import LoginScreen from "./screens/LoginScreen";
import Admin from "./Admin";
import AdminBanner from "../src/Admin/Banner/Banners";
import InBanner from "./Admin/Banner/inBanner.js/InBanner";
import AddBanner from "./Admin/Banner/AddBanner/AddBanner";
import AdminWork from "../src/Admin/Works/Works";
import inWorks from "./Admin/Works/inWork/InWorks";
import AddWork from "./Admin/Works/AddWorks/AddWorks";
import Highlights from "./Admin/Highlights/Highlights";
import InHighlight from "./Admin/Highlights/inHighlights/InHighlights";
import AddHighlight from "./Admin/Highlights/AddHighlights/AddHighlights";
import Magazines from "./Admin/Magazine/Magazines";
import InMagazine from "./Admin/Magazine/inMagazine/InMagazine";
import AddMagazine from "./Admin/Magazine/AddMagazine/AddMagazine";
import IhelpHr from "./screens/Services/HR/IhelpHr";
import HomeMagazine from "./screens/Services/Magazine/HomeMagazine";
import ihelpDeal from "./screens/Services/Deal/ihelpDeal";
import IhelpPlus from "./screens/Services/Plus/iHelpPlus";
import IhelpChamp from "./screens/Services/Champ/IhelpChamp";
import HomeWork from "./screens/Works/HomeWork";
import WorkItemDetail from "./screens/Works/WorkItemDetail";
import IhelpContact from "./screens/Contact/Index";
import MagazineSubs from "./Admin/Subscription/MagazineSubs";
import MarketingSubs from "./Admin/Subscription/MarketingSubs";
import PlusSubs from "./Admin/Subscription/PlusSubs";
import Error from "./screens/Error";
const App = () => {
  return (
    <Router>
      <PageScrollTop>
        <Switch>
          <Route
            path={`${process.env.PUBLIC_URL + "/"} `}
            exact
            component={HomeScreen}
          />
          <Route
            path={`${process.env.PUBLIC_URL + "/work-detail/:id"}`}
            exact
            component={WorkItemDetail}
          />
          <Route
            path={`${process.env.PUBLIC_URL + "/login"}`}
            exact
            component={LoginScreen}
          />
          <Route
            path={`${process.env.PUBLIC_URL + "/admin"}`}
            exact
            component={Admin}
          />
          <Route
            path={`${process.env.PUBLIC_URL + "/adminBanners"}`}
            exact
            component={AdminBanner}
          />
          <Route
            path={`${process.env.PUBLIC_URL + "/headerBanner/:id"}`}
            exact
            component={InBanner}
          />
          <Route
            path={`${process.env.PUBLIC_URL + "/addBanner"}`}
            exact
            component={AddBanner}
          />
          <Route
            path={`${process.env.PUBLIC_URL + "/adminWorks"}`}
            exact
            component={AdminWork}
          />
          <Route
            path={`${process.env.PUBLIC_URL + "/works/:id"}`}
            exact
            component={inWorks}
          />
          <Route
            path={`${process.env.PUBLIC_URL + "/addWorks"}`}
            exact
            component={AddWork}
          />
          <Route
            path={`${process.env.PUBLIC_URL + "/error"}`}
            exact
            component={Error}
          />
          <Route
            path={`${process.env.PUBLIC_URL + "/adminHighlights"}`}
            exact
            component={Highlights}
          />
          <Route
            path={`${process.env.PUBLIC_URL + "/highlights/:id"}`}
            exact
            component={InHighlight}
          />
          <Route
            path={`${process.env.PUBLIC_URL + "/addHighlight"}`}
            exact
            component={AddHighlight}
          />
          <Route
            path={`${process.env.PUBLIC_URL + "/adminMagazines"}`}
            exact
            component={Magazines}
          />
          <Route
            path={`${process.env.PUBLIC_URL + "/books/:id"}`}
            exact
            component={InMagazine}
          />
          <Route
            path={`${process.env.PUBLIC_URL + "/addMagazine"}`}
            exact
            component={AddMagazine}
          />
          <Route
            path={`${process.env.PUBLIC_URL + "/ihelpHR"}`}
            component={IhelpHr}
          />
          <Route
            path={`${process.env.PUBLIC_URL + "/ihelpMagazine"}`}
            exact
            component={HomeMagazine}
          />
          <Route
            path={`${process.env.PUBLIC_URL + "/ihelpDeal"}`}
            exact
            component={ihelpDeal}
          />
          <Route
            path={`${process.env.PUBLIC_URL + "/ihelpPlus"}`}
            exact
            component={IhelpPlus}
          />
          <Route
            path={`${process.env.PUBLIC_URL + "/ihelpChamp"}`}
            exact
            component={IhelpChamp}
          />
          <Route
            path={`${process.env.PUBLIC_URL + "/homeWork"}`}
            exact
            component={HomeWork}
          />
          <Route
            path={`${process.env.PUBLIC_URL + "/ihelpContact"}`}
            exact
            component={IhelpContact}
          />
          <Route
            path={`${process.env.PUBLIC_URL + "/magazineSubs"}`}
            exact
            component={MagazineSubs}
          />
          <Route
            path={`${process.env.PUBLIC_URL + "/marketingSubs"}`}
            exact
            component={MarketingSubs}
          />
          <Route
            path={`${process.env.PUBLIC_URL + "/plusSubs"}`}
            exact
            component={PlusSubs}
          />
        </Switch>
      </PageScrollTop>
    </Router>
  );
};

export default App;
